import Dog from "./Dog";
import { Link } from "react-router-dom";
import React, { useState } from "react";
import "../stylesheets/layouts/DogList.scss";
import logo from "../images/logo-w.png";

const DogList = (props) => {
  const handleClickPrev = () => {
